import React, { Component } from 'react';
import './App.css';
import {InitNotification} from './initNotification.js'

class App extends Component {
  render() {
    InitNotification();
    return (

      <div className="App">

        <h1>Notification Test</h1>
      </div>
    );
  }
}

export default App;
